def load_profile(address):
	bc_info_acct = 'https://blockchain.info/rawaddr/%s%s'%(address,api_code)
	get_account = urllib.request.urlopen(bc_info_acct)
	data = json.loads(get_account.read().decode("utf-8"))
	#print('address: {}'.format(data['address']))
	#address = data['address']
	#print('n_tx: {}'.format(data['n_tx']))
	n_tx = data['n_tx']
	if n_tx >48:
		return None
	#print('total_received: {}'.format(data['total_received']))
	#print('total_sent: {}'.format(data['total_sent']))
	#print('final_balance: {}'.format(data['final_balance']))
	#print('txs: {}'.format(data['txs'][0]['time']))
	#print('outs: {}'.format(data['txs'][0]['out'][0]['addr']))
	txs =data['txs']
	#is_out = data['txs'][x]['out']
	#is_addr = data['txs'][0]['out'][0]['addr'] 
	#print(is_addr)
	x = 0
	y = 0
	profile_arry=[]
	while x <  n_tx:
		#print(x)
		outs = data['txs'][x]['out'] 
		for out in outs:
			try:
				out_addr = data['txs'][x]['out'][y]['addr']
				spent = data['txs'][x]['out'][y]['spent']
				value = data['txs'][x]['out'][y]['value']
				time_tx = data['txs'][x]['time']
				#print(time_tx)
				bc_info_hist = "https://blockchain.info/frombtc?value=%s&currency=USD&time=%s000&textual=false&nosavecurrency=true%s"%(value,time_tx,api_code)
				bc_info_curr = "https://blockchain.info/frombtc?value=%s&currency=USD&time=%s000&textual=false&nosavecurrency=true%s"%(value,now,api_code)
				if out_addr == address:
					#print(bc_info_hist)
					#if spent = false then find latest time and first time . subtract these to get eaa
					get_stake1 = urllib.request.urlopen(bc_info_hist)
					fiat_invest = get_stake1.read().decode("utf-8")
					get_stake2 = urllib.request.urlopen(bc_info_curr)
					fiat_curr = get_stake2.read().decode("utf-8")
					#print("Invested:",fiat_invest,"Earned:",fiat_curr)
					#print ("addr:",out_addr,"spent:",spent,"time:", time, "value:", value, "Fiat Investment:", fiat_invest,"Fiat Current:",fiat_curr)
					profile_dict = {"addr":out_addr,"spent":spent,"time":time_tx, "value": value, "val_invest": fiat_invest,"val_fiat":fiat_curr,"b":data['final_balance'],"r":data['total_received'],'n_txs':data['n_tx']}
					#print (profile_dict)
					profile_arry.append(profile_dict)
			except Exception as e:
				print (e)
			y = y + 1
		y = 0
		x = x + 1
	return profile_arry





def print_profile(profile):
	if profile[0]['b'] == 0:
		return None
	sum_inv = 0
	sum_gain = 0
	sum_save = 0
	sum_spent = 0
	last_time = 0
	first_time = 0
	for x in profile:
		print(x)
		if profile[profile.index(x)]['spent'] == False:
			sum_inv = sum_inv + float(profile[profile.index(x)]['val_invest'].replace(',',''))
			sum_gain = sum_gain + float(profile[profile.index(x)]['val_fiat'].replace(',',''))
			first_time = profile[profile.index(x)]['time']
			if sum_save == 0:
				last_time = profile[profile.index(x)]['time']
			sum_save = sum_save + 1	  
		#if profile[profile.index(x)]['spent'] == "true":
		else:
			sum_inv = sum_inv - float(profile[profile.index(x)]['val_invest'].replace(',',''))
			sum_gain = sum_gain - float(profile[profile.index(x)]['val_fiat'].replace(',',''))
			sum_spent = sum_save + 1 
	try:	
		inv_stake = (sum_inv/sum_gain) * float(profile[profile.index(x)]['b'])
		#print("invested:",sum_inv)
		#print("earned:",sum_gain)
	except Exception as e:
		inv_stake = 0
	earned_age = (int(last_time) - int(first_time))+ 86400  
	spender_rate = float(profile[0]['b'])/float(profile[0]['r'])
	#how big are your transactions of coins kept / quality deposits
	stake_pts = inv_stake*spender_rate
	trans_value = (sum_save/float(profile[0]['b']))
	print("m",sum_save*trans_value)
	activity = (earned_age*sum_save*trans_value)
	b = float(profile[0]['b'])
	#print(spender_rate,trans_value,activity)
	#print("b:",profile[profile.index(x)]['b'])
	print("earned age", earned_age)
	print("spend_rate",spender_rate)
	print("trans_value",trans_value)
	print("activity",activity)
	trust = ((activity*earned_age))
	#print(earned_age)

	print("%s,%s,%s,%s"%(str(profile[0]['addr']),str(int((stake_pts*.000001))),format(trust,'.2f'),format(b*.00000001,'.3f')))
	BC_csv.write("%s,%s,%s,%s\n"%(str(profile[0]['addr']),str(int((stake_pts*.000001))),format(trust,'.2f'),format(b*.00000001,'.3f')))

